import React, { useState } from 'react';

function App() {
    const [response, setResponse] = useState('');

    const fetchData = async () => {
        try {
            const res = await fetch('http://localhost:8080/api/data'); // Замените URL на ваш REST-эндпоинт
            const data = await res.json();
            setResponse(JSON.stringify(data));
        } catch (error) {
            console.error('Ошибка при получении данных:', error);
        }
    };

    return (
        <div>
            <h1>Пример REST-запроса на Spring Boot приложение</h1>
            <button onClick={fetchData}>Отправить запрос</button>
            <div>
                <h2>Ответ:</h2>
                <pre>{response}</pre>
            </div>
        </div>
    );
    <Link to="/home_page">Перейти на другую страницу</Link>
}

export default App;
